const reducerCoach = (state = initialState, action) => {
    switch (action.type){
        case 'ADD_TITULAR':
                if(state.titulars.length < 11){
                    return( {...state,
                        titulars: state.titulars.concat(action.player),
                        players: state.players.filter(player => player.id !== action.player.id)
                    }
                    )
                }
            break;
        case 'ADD_SUBSTITUTE':
            return ({
                ...state,
                substitutes: state.substitutes.concat(action.player),
                players: state.players.filter(player => player.id !== action.player.id)
            })
            break;
        case 'DEL_TITULAR':
            return ({
                ...state,
                titulars: state.titulars.filter(player => player.id !== action.player.id),
                players: state.players.concat(action.player)
            })
            break;
        case 'DEL_SUBSTITUTE':
            return ({
                ...state,
                substitutes: state.substitutes.filter(player => player.id !== action.player.id),
                players: state.players.concat(action.player)
            })
            break;
    }
    return state
}
export default createStore(reducerCoach)
